import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Register from "./pages/Register";
import Login from "./pages/Login";
import Dashboard from "./pages/Dashboard";
import "./styles.css";

const Home = () => {
  return (
    <>
      <div className="full-width-header">
        <h1 className="title">Welcome to Premium Payment Solutions</h1>
        <p className="subtitle">
          Convert currencies and manage your payments effortlessly
        </p>
        <div className="button-container">
          <Link to="/register" className="button primary-button">
            Register
          </Link>
          <Link to="/login" className="button primary-button">
            Login
          </Link>
        </div>
      </div>
      <div className="container">
        <main className="text-center mt-4">
          <h2 className="subtitle">Why Choose Our Payment Page?</h2>
          <p>
            Experience seamless currency conversion, secure transactions, and
            more.
          </p>
        </main>
      </div>
    </>
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
      </Routes>
    </Router>
  );
};

export default App;
